export default function getSearch(string, listToRender, profileData) {
  let returnedObject = {}

  listToRender.forEach((listItem) => {
    listItem = listItem.toLowerCase()
    let returnedList = []

    switch(listItem) {
      case "device":
        profileData[listItem]?.forEach(value => {
          let cleanArray = value.slice(1, Object.keys(value).at(-1))
          for (let i in cleanArray) {
            if (cleanArray[i]['data'].toLowerCase().includes(string.target.value.toLowerCase())) {
              returnedList.push(value)
              break
            }
          }
        })
      case "user":
      profileData[listItem]?.forEach(value => {
        let cleanArray = value.slice(1, Object.keys(value).at(-1))
        for (let i in cleanArray) {
          if (cleanArray[i]['data'].toLowerCase().includes(string.target.value.toLowerCase())) {
            returnedList.push(value)
            break
          }
        }
      })
      default: {}
    }

    returnedObject[listItem] = returnedList
  })

  return returnedObject
}
